  return (
    <div className={classes.Cata}>
      <Typography variant="h4">Category</Typography>
      <hr />
      <Box mt={3} className={classes.grd}>
        <div className={classes.img}>
          <img src="https://picsum.photos/450/300" />
          <Typography variant="h4">Fashion</Typography>
        </div>
        <div>
          <img src="https://picsum.photos/450/300" />
          <Typography variant="h4">Lorem </Typography>
        </div>
        <div>
          <img src="https://picsum.photos/450/300" />
          <Typography variant="h4">Lorem </Typography>
        </div>
      </Box>
    </div>
  );
};

export default CategoryCard;
const useStyles = makeStyles((theme) => ({
  Cata: {
    padding: "50px",
  },
  grd: {
    display: "grid",
    gridTemplateColumns: "1fr 1fr 1fr",
  },
  img: {
    width: "350px",
    textAlign: "center",
    borderRadius: "10px",
    boxShadow: "2px 4px 8px #dedede",
  },
}));
